// src/admin/Sidebar.jsx
import React from 'react';
import { NavLink } from 'react-router-dom';
import './styles/Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <h2 className="sidebar-title">Admin Panel</h2>
      <nav className="sidebar-nav">
        <NavLink to="/admin/products/add" activeclassname="active">Add Product</NavLink>
        <NavLink to="/admin/products/update" activeclassname="active">Update Product</NavLink>
        <NavLink to="/admin/orders/all" activeclassname="active">All Orders</NavLink>
        <NavLink to="/admin/orders/update" activeclassname="active">Update Order</NavLink>
        <NavLink to="/admin/messages" activeclassname="active">All Messages</NavLink>
      </nav>
    </div>
  );
};

export default Sidebar;
